import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router-dom";

const SplashPage = () => {
  const sessionUser = useSelector((state) => state.session.user);
  const dispatch = useDispatch();
  const history = useHistory();
  if (sessionUser) return history.push("/products");

  return (
    <>
    <h1 className="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-zinc-800 m-4">Organize Bonanza</h1>
    <h2 className="mb-2 text-xl font-bold tracking-tight text-gray-900 dark:text-zinc-800 m-4">Organize Bonanza</h2>
    </>
  )
}

export default SplashPage;
